import { Link, useNavigate, useParams } from "react-router-dom";
import Reservation from "../interfaces/Reservation";
import '../App.css';
import { useReservationContext } from "../store/ReservationContext";
import { useEffect, useState } from "react";

const EditReservation = () => {
    const { id } = useParams();
    const navigate = useNavigate();
    const { reservations, editReservation, removeReservation } = useReservationContext();

    const [formData, setFormData] = useState<Reservation | undefined>(reservations.find((res) => res.id === id));

    useEffect(() => {
        if (!formData) {
            navigate('/');
        }
    }, [formData, navigate]);

    const handleEdit = () => {
        if (!formData) {
            return;
        }
        editReservation(formData as Reservation);
        navigate('/');
    };

    const handleChanges = (e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>) => {
        setFormData((prevData) => {
            return {
                ...(prevData as Reservation),
                [e.target.name]:
                    e.target.name === 'phoneNumber' || e.target.name === 'guestCount' || e.target.name === 'tableNumber'
                        ? parseInt(e.target.value)
                        : e.target.value,
            };
        });
    };

    const handleRemoveReservation = (id: string, e: React.MouseEvent<HTMLButtonElement>) => {
        e.preventDefault();
        removeReservation(id);
        navigate('/');
    };

    const handleFinishedReservation = (id: string) => {
        const reservationToMarkAsCompleted = reservations.find((reservation) => reservation.id === id);

        if (!reservationToMarkAsCompleted) {
            return;
        }

        reservationToMarkAsCompleted.isCompleted = true;

        // Call the editReservation function from the context to update the reservation
        editReservation(reservationToMarkAsCompleted);
        navigate('/');
    };

    const increaseCount = (e: React.MouseEvent<HTMLButtonElement>) => {
        e.preventDefault();
        if (formData) {
            setFormData({
                ...formData,
                guestCount: formData.guestCount + 1
            } as Reservation);
        }
    };

    const decreaseCount = (e: React.MouseEvent<HTMLButtonElement>) => {
        e.preventDefault();
        if (formData) {
            setFormData({
                ...formData,
                guestCount: formData.guestCount - 1
            } as Reservation);
        }
    }

    return (
        <>
            <nav className="App-nav">
                <Link onClick={handleEdit} to="/">Back</Link>
                <h1 className="App-nav-h1">Edit Reservation</h1>
                <span>X</span>
            </nav>
            <div className="container">
                {formData ? (
                    <form>
                        <div>
                            <label>Customer Name</label>
                            <input type="text" name="customerName" value={formData.customerName} onChange={handleChanges} />
                        </div>
                        <div>
                            <label>Phone Number</label>
                            <input type="tel" name="phoneNumber" value={formData.phoneNumber} onChange={handleChanges} />
                        </div>
                        <div className="d-flex align-items-center">
                            <label>Guests</label>
                            <button className="btn btn-count" onClick={decreaseCount}>-</button>
                            {/* <input className="mx-3" type="number" name="guestCount" value={formData.guestCount} onChange={handleChange} /> */}
                            <input className="mx-3" type="number" name="guestCount" value={formData.guestCount} onChange={handleChanges} />
                            <button className="btn btn-count" onClick={increaseCount}>+</button>
                        </div>
                        <div>
                            <label>Guest Count</label>
                            <input type="number" name="guestCount" value={formData.guestCount} onChange={handleChanges} />
                        </div>
                        <div>
                            <label>Table Number</label>
                            <input type="number" name="tableNumber" value={formData.tableNumber} onChange={handleChanges} />
                        </div>
                        <div>
                            <label>Note</label>
                            <textarea name="note" value={formData.note} onChange={handleChanges}></textarea>
                        </div>
                        {/* <button type="button" onClick={handleEdit}>
                            Save Changes
                        </button> */}
                        <div className="d-flex justify-content-between">
                            <button className="btn btn-remove me-3" onClick={(e) => handleRemoveReservation(formData.id, e)}>X</button>
                            <button className="btn btn-confirm" onClick={(e) => { e.preventDefault(); handleFinishedReservation(formData.id); }}>
                                Seated
                            </button>
                        </div>
                    </form>
                ) : null}
            </div>
        </>
    )
};

export default EditReservation;
